pragma solidity >=0.4.21 <0.6.0;
import "./ERC721Mintable.sol";
import "./SquareVerifier.sol";

// TODO define a contract call to the zokrates generated solidity contract <Verifier> or <renamedVerifier>
contract UseSquareVerifier is SquareVerifier {
}

// TODO define another contract named SolnSquareVerifier that inherits from your ERC721Mintable class
contract SolnSquareVerifier is CustomERC721Token {
    // TODO define a solutions struct that can hold an index & an address
    struct solution {
        uint256 tokenId;
        address owner;
    }

    // TODO define an array of the above struct
    solution[] solutionsArray;

    //Define verifier
    UseSquareVerifier verifier;

    // TODO define a mapping to store unique solutions submitted
    mapping(bytes32 => solution) solutionsMapping;

    // TODO Create an event to emit when a solution is added
    event SolutionAdded(uint index, address user);

    constructor (address verifierAdd) public {
        verifier = UseSquareVerifier(verifierAdd);
    }

    // TODO Create a function to add the solutions to the array and emit the event
    function addSolution(uint index, address user, bytes32 key) internal
    {
        solution memory sol = solution({tokenId: index, owner: user});
        solutionsArray.push(sol);
        //Add to mapping
        solutionsMapping[key] = sol;

        emit SolutionAdded(index, user);
    }

    // TODO Create a function to mint new NFT only after the solution has been verified
    //  - make sure the solution is unique (has not been used before)
    //  - make sure you handle metadata as well as tokenSuplly
    function mint
        (
            address to,
            uint256 tokenId,
            uint[2] memory a,
            uint[2] memory a_p,
            uint[2][2] memory b,
            uint[2] memory b_p,
            uint[2] memory c,
            uint[2] memory c_p,
            uint[2] memory h,
            uint[2] memory k,
            uint[2] memory input 
        ) 
        public 
    { 
        //check if token already minted
        bool minted = false;
        for (uint i= 0; i< solutionsArray.length; i++){
            if(solutionsArray[i].tokenId == tokenId){
                minted = true;
                break;
            }
        }
        require(minted == false, "Token Already minted");

        //Check if unique solution provided
        bytes32 key = getKey(a, a_p, b, b_p, c, c_p, h, k, input);
        solution memory sol = solutionsMapping[key];
        require(sol.owner == address(0), "Solution already used");

        //Verify the solution
        require(verifier.verifyTx(a, a_p, b, b_p, c, c_p, h, k, input) == true, "Unable to verify. Incorrect Proof.");

        addSolution(tokenId, to, key);
        super.mint(to, tokenId);
    }

    function getKey
        (
            uint[2] memory a,
            uint[2] memory a_p,
            uint[2][2] memory b,
            uint[2] memory b_p,
            uint[2] memory c,
            uint[2] memory c_p,
            uint[2] memory h,
            uint[2] memory k,
            uint[2] memory input
        ) 
        internal
        pure
        returns(bytes32 key)
    {
        key = keccak256(abi.encodePacked(a, a_p, b, b_p, c, c_p, h, k, input));
    }

}
